INSERT INTO `base_notification` VALUES (0x3965613337653032343261623238663436316664656133303364623832313333, '七一表彰通知', '七一表彰通知', '<p class=\"reader-word-layer reader-word-s5-7\">今年以来，全镇各级党组织和广大共产党员在镇党委的领导下，</p>\n<p class=\"reader-word-layer reader-word-s5-14\">以十八大四中全会和习近平总书记的讲话精神为指导，以经济建设为</p>\n<p class=\"reader-word-layer reader-word-s5-17\">中心，围绕全镇工作大局，扎实推进各项工作，取得</p>\n<p class=\"reader-word-layer reader-word-s5-15\">...</p>\n<p class=\"reader-word-layer reader-word-s5-19\">中秋节国庆节</p>\n<p class=\"reader-word-layer reader-word-s5-4\">期间应急管理工作通知各街道办事处、乡镇人民政府，区政府各部</p>\n<p class=\"reader-word-layer reader-word-s5-16\">门、各直属机构</p>\n<p class=\"reader-word-layer reader-word-s5-7\">今年以来，全镇各级党组织和广大共产党员在镇党委的领导下，</p>\n<p class=\"reader-word-layer reader-word-s5-14\">以十八大四中全会和习近平总书记的讲话精神为指导，以经济建设为</p>\n<p class=\"reader-word-layer reader-word-s5-17\">中心，围绕全镇工作大局，扎实推进各项工作，取得</p>\n<p class=\"reader-word-layer reader-word-s5-15\">...</p>\n<p class=\"reader-word-layer reader-word-s5-19\">中秋节国庆节</p>\n<p class=\"reader-word-layer reader-word-s5-4\">期间应急管理工作通知各街道办事处、乡镇人民政府，区政府各部</p>\n<p class=\"reader-word-layer reader-word-s5-16\">门、各直属机构</p>', '2020-07-29 15:05:50', '1', '1', null, '2', null, '3', '0', '0', '13420516645', '2020-07-29 14:23:40', '13420516645', '2020-07-29 15:05:50', '127.0.0.1', null, null, null, '1', '3000');
INSERT INTO `base_notification` VALUES (0x6131633239313061363662633162323963636363383764653331343636616637, '十一国庆节期间燃气安全工作通知各镇人民政府、街道办公告', '十一国庆节期间燃气安全工作通知各镇人民政府、街道办公告', '<div id=\"pageNo-1\" class=\"reader-page \" data-page-no=\"1\" data-mate-width=\"918\" data-mate-height=\"1188\" data-scale=\"0.7727272727272727\" data-render=\"1\">\n<div class=\"reader-parent-3e58e4f94028915f804dc29b reader-parent \">\n<div class=\"reader-wrap3e58e4f94028915f804dc29b\">\n<div class=\"reader-main-3e58e4f94028915f804dc29b\">\n<div class=\"reader-txt-layer\">\n<div class=\"ie-fix\">\n<p class=\"reader-word-layer reader-word-s1-8\">为全面贯彻落实国家和省、市有关安全工作的指示精神，确保燃</p>\n<p class=\"reader-word-layer reader-word-s1-12\">气安全运行，现就做好&ldquo;十一&rdquo;国庆节期间的燃气安全工作的有关事</p>\n<p class=\"reader-word-layer reader-word-s1-5\">项通知如</p>\n<p class=\"reader-word-layer reader-word-s1-18\">&nbsp;</p>\n<p class=\"reader-word-layer reader-word-s1-5\">个&ldquo;世界粮食日&rdquo;暨&ldquo;放心粮油&rdquo;进社区活动意见通知如下：</p>\n<p class=\"reader-word-layer reader-word-s1-10\">&ensp;</p>\n<p class=\"reader-word-layer reader-word-s1-5\">一、指导思想为贯彻落实中共中央</p>\n<p class=\"reader-word-layer reader-word-s1-15 reader-word-s1-18\">...</p>\n<p class=\"reader-word-layer reader-word-s1-20\">表彰先进党支部优秀共产党</p>\n<p class=\"reader-word-layer reader-word-s1-17\">员通报一年来，在上级党组织的正确领导下，学校党委深入贯彻落实</p>\n<p class=\"reader-word-layer reader-word-s1-12\">党的十八届四中全会精神和习近平总书记系列讲话精神，深入推进社</p>\n<p class=\"reader-word-layer reader-word-s1-17\">会主义核心价值观教育，积极开展党的群众路线教育实践活动，全面</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div id=\"pageNo-2\" class=\"reader-page \" data-page-no=\"2\" data-mate-width=\"918\" data-mate-height=\"1188\" data-scale=\"0.7727272727272727\" data-render=\"1\">\n<div class=\"reader-parent-3e58e4f94028915f804dc29b reader-parent \">\n<div class=\"reader-wrap3e58e4f94028915f804dc29b\">\n<div class=\"reader-main-3e58e4f94028915f804dc29b\">\n<div class=\"reader-txt-layer\">\n<div class=\"ie-fix\">\n<p class=\"reader-word-layer reader-word-s2-7\">&nbsp;</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', '2020-07-29 14:07:56', '0', '0', '2020-08-01 12:00:00', '2', null, '3', '0', '0', '15717737255', '2020-07-29 13:49:02', '15717737255', '2020-07-29 14:07:56', '127.0.0.1', null, null, null, '1', '3000');
