INSERT INTO `base_notification` VALUES (0x6563356461343734633665313833616561626439653938663761346432353565, '2020年中秋节国庆节放假通知', '2020年中秋节国庆节放假通知', '<p class=\"reader-word-layer reader-word-s5-7\">根据国务院办公厅关于</p>\n<p class=\"reader-word-layer reader-word-s5-8\">201X</p>\n<p class=\"reader-word-layer reader-word-s5-4\">年部分节假日安排的通知（国办发明</p>\n<p class=\"reader-word-layer reader-word-s5-7\">期间严格落实中央八项规定精神的通知各分党委、总</p>\n<p class=\"reader-word-layer reader-word-s5-16\">（直）支，各单位，机关各部处：</p>', '2020-07-29 14:21:17', '0', '1', null, '2', null, '3', '1', '0', 'admin', '2020-07-29 14:21:01', 'admin', '2020-07-29 14:21:17', '127.0.0.1', null, null, null, '1', '3000');
INSERT INTO `base_notification` VALUES (0x6565646463316432356430633330373638656432343833633038393161666366, '中秋节、国庆节放假安排', '中秋节、国庆节放假安排', '<p class=\"reader-word-layer reader-word-s4-10\">（一）中秋节放假时间</p>\n<p class=\"reader-word-layer reader-word-s4-15\">9&ensp;</p>\n<p class=\"reader-word-layer reader-word-s4-1\">月</p>\n<p class=\"reader-word-layer reader-word-s4-16\">27</p>\n<p class=\"reader-word-layer reader-word-s4-1\">日</p>\n<p class=\"reader-word-layer reader-word-s4-5\">&ensp;</p>\n<p class=\"reader-word-layer reader-word-s4-1\">放假</p>\n<p class=\"reader-word-layer reader-word-s4-17\">...</p>\n<p class=\"reader-word-layer reader-word-s4-12\">中秋走访慰问活动通</p>\n<p class=\"reader-word-layer reader-word-s4-11\">知各街道新居民所：</p>\n<p class=\"reader-word-layer reader-word-s4-5\">&ensp;</p>\n<p class=\"reader-word-layer reader-word-s4-10\">中秋将至，为深入贯彻落实党的十八大和十八届三中、四中全会</p>\n<p class=\"reader-word-layer reader-word-s4-1\">精神，培育和践行社会主义核心价值观，营造和谐、幸福的节日氛</p>\n<p class=\"reader-word-layer reader-word-s4-11\">围，充分体现党和政府对我区新居民的亲切关怀，确保他</p>\n<p class=\"reader-word-layer reader-word-s4-17\">...</p>\n<p class=\"reader-word-layer reader-word-s4-10\">学校中秋</p>\n<p class=\"reader-word-layer reader-word-s4-10\">国庆两节放假通知各部门、各单位：</p>', '2020-07-29 14:11:16', '0', '0', null, '2', null, '3', '0', '0', '15717737255', '2020-07-29 14:11:04', '15717737255', '2020-07-29 14:11:16', '127.0.0.1', null, null, null, '1', '3000');
