-- ----------------------------
-- Table structure for biz_order
-- ----------------------------
DROP TABLE IF EXISTS `biz_order`;
CREATE TABLE `biz_order` (
  `id` binary(32) NOT NULL COMMENT '订单ID',
  `company_id` binary(32) NOT NULL,
  `ref` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '订单号',
  `code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '订单本地编码',
  `sku_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商品SKUID',
  `product_id` binary(32) NOT NULL COMMENT '组合产品ID',
  `product_name` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '组合产品名称',
  `product_count` int(11) DEFAULT '0' COMMENT '组合产品数量',
  `product_price` decimal(11,2) DEFAULT '0.00' COMMENT '组合产品价格',
  `profit` decimal(11,2) DEFAULT '0.00' COMMENT '利润',
  `status` tinyint(2) NOT NULL DEFAULT '3' COMMENT '状态',
  `order_time` datetime NOT NULL,
  `salesman_id` binary(32) DEFAULT NULL COMMENT '业务员ID',
  `salesman_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '业务员名称',
  `position_id` binary(32) DEFAULT NULL COMMENT '业务员岗位ID',
  `payment_status` tinyint(4) DEFAULT '0' COMMENT '收款状态',
  `customer_id` binary(32) DEFAULT NULL COMMENT '客户ID',
  `customer_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '客户名称',
  `contact_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '联系人名称',
  `contact_phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '联系人电话',
  `contact_email` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系人邮箱',
  `contact_id_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  `detailed_data` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '详细信息',
  `deleted` tinyint(1) NOT NULL DEFAULT '0',
  `create_time` datetime DEFAULT NULL,
  `create_by` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `last_oper_by` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `last_oper_time` datetime DEFAULT NULL,
  `deleted_by` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `deleted_time` datetime DEFAULT NULL,
  `last_oper_ip` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `platform_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '平台类型',
  `order_price` decimal(13,2) NOT NULL,
  `contact_id_type` tinyint(4) DEFAULT '1' COMMENT '证件类型（默认身份证）',
  `contact_py` varchar(223) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系人姓名拼音',
  `gap_price` decimal(11,2) DEFAULT '0.00' COMMENT '差价',
  `use_start_date` date DEFAULT NULL COMMENT '使用开始时间',
  `use_end_date` date DEFAULT NULL COMMENT '使用结束时间',
  `purchase_amount` decimal(13,2) DEFAULT '0.00' COMMENT '采购总额',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `order_time` (`order_time`),
  KEY `company_id` (`company_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC COMMENT='订单信息表';

