-- ----------------------------
-- Table structure for biz_order_product
-- ----------------------------
DROP TABLE IF EXISTS `biz_order_product`;
CREATE TABLE `biz_order_product` (
  `id` binary(32) NOT NULL,
  `company_id` binary(32) NOT NULL,
  `supplier_id` binary(32) NOT NULL COMMENT '供应商ID',
  `supplier_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '供应商名称',
  `supplier_code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '供应商编码',
  `product_id` binary(32) NOT NULL COMMENT '产品ID',
  `product_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '产品名称',
  `product_code` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '产品编码',
  `product_attr` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '产品属性组合',
  `purchase_currency` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT 'CNY' COMMENT '采购货币，默认为人民币（CNY）',
  `purchase_rate` decimal(11,4) NOT NULL DEFAULT '0.0000' COMMENT '采购汇率',
  `sale_currency` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT 'CNY' COMMENT '销售货币，默认为人民币（CNY）',
  `sale_rate` decimal(11,4) DEFAULT '0.0000' COMMENT '销售汇率',
  `purchase_time` datetime DEFAULT NULL COMMENT '采购时间',
  `purchase_count` int(11) NOT NULL DEFAULT '0' COMMENT '采购数量',
  `purchase_price` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '采购价格',
  `purchase_rated_price` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '汇率换算后的采购价格',
  `purchase_amount` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '采购金额',
  `purchase_rated_amount` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '汇率换算后的采购金额',
  `sale_price` decimal(11,2) DEFAULT '0.00' COMMENT '销售价格',
  `sale_rated_price` decimal(11,2) DEFAULT '0.00' COMMENT '汇率换算后的销售价格',
  `sale_amount` decimal(13,2) DEFAULT '0.00' COMMENT '销售金额',
  `sale_rated_amount` decimal(13,2) DEFAULT '0.00' COMMENT '汇率换算后的销售金额',
  `profit` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '汇率换算后的利润',
  `settle_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '结算方式：0-下单现结 1-使用后结',
  `settle_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已结算：0-未结算 1-已结算',
  `use_date` date DEFAULT NULL COMMENT '使用日期',
  `remark` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '备注',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `product_id` (`product_id`),
  KEY `supplier_id` (`supplier_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='订单供应商产品表';

