  `approval_by` binary(32) DEFAULT NULL COMMENT '审批人',
  `approval_status` tinyint(1) DEFAULT '1' COMMENT '审批状态：1为待审批 2为审批退回 3审批通过 ',
  `source` tinyint(1) DEFAULT '0' COMMENT '来源：1为平台公告  0为企业内公告',
  `deleted` tinyint(1) DEFAULT '0' COMMENT '是否删除: 1为已删除,0为正常数据',
  `create_by` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '创建人',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_oper_by` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '最后操作人',
  `last_oper_time` datetime NOT NULL COMMENT '最后操作时间',
  `last_oper_ip` varchar(30) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `deleted_by` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '删除人',
  `deleted_time` datetime DEFAULT NULL COMMENT '删除时间',
  `remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '备注',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态：1为启用 0为禁用',
  `duration` int(11) DEFAULT '0' COMMENT '消息窗口存在时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC COMMENT='通知-消息主体表';

